import React from "react";
import Contacts from "./Contacts/Contacts";
import c from "./personalArea.module.css"
import AddContactsForm from "./AddContactsForm/AddContactsForm";

const PersonalArea = ({contacts, addContactSubmit, deleteContact, updateContact}) => {
    return (
        <div className={c.personalAreaContent}>
            <AddContactsForm addContactSubmit = {addContactSubmit} />
            <div className={c.listContacts}>
                {contacts.map(i => <Contacts
                                            updateContact = {updateContact}
                                            contacts = {i}
                                            key = {i.id}
                                            name = {i.name}
                                            status = {i.status}
                                            deleteContact = {deleteContact}/>)}
            </div>
        </div>
    )
}

export default PersonalArea
